    <title>Index</title>
    <script>
     const iterable1 = {};

iterable1[Symbol.iterator] = function* () {
  yield 7;
  yield 2;
  yield 3;
};

console.log([...iterable1]);
// expected output: Array [1, 2, 3]
    </script>
</head>
